void MODEL_mkBridge::destroy_model()
{
  delete mkBridge_instance;
  mkBridge_instance = NULL;
  scemi_shutdown(sim_hdl);
}
void MODEL_mkBridge::reset_model(bool asserted)
{
  (mkBridge_instance->reset_RST_N)(asserted ? (tUInt8)0u : (tUInt8)1u);
}
void * MODEL_mkBridge::get_instance()
{
  return mkBridge_instance;
}

/* Fill in version numbers */
void MODEL_mkBridge::get_version(unsigned int *year,
				 unsigned int *month,
				 char const **annotation,
				 char const **build)
{
  *year = 2014u;
  *month = 7u;
  *annotation = "A";
  *build = "34078";
}

/* Get the model creation time */
time_t MODEL_mkBridge::get_creation_time()
{
  
  /* Wed Apr  6 20:13:50 UTC 2016 */
  return 1459973630llu;
}

/* Control run-time licensing */
tUInt64 MODEL_mkBridge::skip_license_check()
{
  return 0llu;
}

/* State dumping function */
void MODEL_mkBridge::dump_state()
{
  (mkBridge_instance->dump_state)(0u);
}

/* VCD dumping functions */
MOD_mkBridge & mkBridge_backing(tSimStateHdl simHdl)
{
  static MOD_mkBridge *instance = NULL;
  if (instance == NULL)
  {
    vcd_set_backing_instance(simHdl, true);
    instance = new MOD_mkBridge(simHdl, "top", NULL);
    vcd_set_backing_instance(simHdl, false);
  }
  return *instance;
}
void MODEL_mkBridge::dump_VCD_defs()
{
  (mkBridge_instance->dump_VCD_defs)(vcd_depth(sim_hdl));
}
void MODEL_mkBridge::dump_VCD(tVCDDumpType dt)
{
  (mkBridge_instance->dump_VCD)(dt, vcd_depth(sim_hdl), mkBridge_backing(sim_hdl));
}
